import React from 'react'

const Navbtn = (props: any) => {
    return (
        <button className="px-3 py-2 mx-5 my-2 srounded-lg hover:bg-gray-200 focus:outline-none" onClick={props.onClick}>{props.text}</button>
    )

}

const AppBar = () => {

  return (
    <div className="w-max bg-white self-end">
      {(
        <>
          <Navbtn text="Scopri" />
          <Navbtn text="Recensioni" />
          <Navbtn text="Classifiche" />
        </>
      )}
    </div>
  )
}

export default AppBar;
